describe('Service: pdfOutput', function () {
  'use strict';

  // load the service's module
  beforeEach(module('axis'));

  // instantiate service
  var pdfOutput,
      jsPDF,
      body,
      result,
      scope,
      canvasPNG = 'data:image/png;base64,';

  beforeEach(inject(function (_pdfOutput_, $rootScope) {
    pdfOutput = _pdfOutput_;
    scope = $rootScope.$new();
    scope.appConfig = {
      'print margins': {
        top: 1,
        left: 2,
        bottom: 3,
        right: 4
      }
    };

    body = angular.element('body');
    body.empty(); // clean up previous tests
    body.append(angular.element('<canvas id="canvas"></canvas>'));
  }));

  it('should return an object with data and margins when this.preprocess() runs', function(){
    result = pdfOutput.preprocess(scope);
    expect(result.margins.top).toBe(1);
    expect(result.margins.bottom).toBe(3);
    expect(result.margins.left).toBe(2);
    expect(result.margins.right).toBe(4);
    expect(result.data.indexOf('data:image/png;base64,')).toBe(0);
  });

  it('should return a jsPDF object when this.process() runs', function () {
    jsPDF = pdfOutput.process({data: canvasPNG, margins: {}});
    expect(typeof jsPDF).toBe('object'); // This could be better...
  });

  // I have no idea how to test this.
  it('should attempt to download a PDF when this.complete() runs', function(){
    jsPDF = pdfOutput.process({data: canvasPNG, margins: {}});
    spyOn(jsPDF, 'save');
    pdfOutput.complete(jsPDF);

    expect(jsPDF.save).toHaveBeenCalled();
  });
});
